  false,\n\t\"url\": null,\n\t\"notes\": \"TREES_BIG2005_IN is a point shapefile showing
  the locations of state champion trees in Indiana. The register is updated every
  5 years. Each location represents a native tree that is the largest individual of
  its species found in Indiana. These locations are based on detailed records of the
  Indiana Big Tree Register 2005 and locations were digitized using 7.5 minute U.S.
  Geological Survey quadrangle maps, various aerial photographic data, streets, hydrology,
  and town layers for reference. Tree measurements are includeded in the attributes.\",\n\t\"owner_org\":
